import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  let [username, changeUsername] = useState(['호랑이', '사자']);
  let [navbarOne, navbarTwo] = useState(false);

  return (
    <div>
      <div className="nav-bar">
        <h3>{ username[0] }님 저장소</h3>
        <ul>
          <button onClick={ ()=>{navbarTwo(true)} }>Todo List</button>
          <button onClick={ ()=>{navbarTwo(false)} }>Done List</button>
        </ul>
      </div>

    {
      navbarOne === true
       ? <Todo />
       : <Done />
    }
    </div>
  );
}


function Todo() {
  let [todo, changeTodo] = useState('');

  return (
    <div>
      <div className="title">
        <h2>Todo List</h2>
      </div>
      <div className="input-box">
        <input id="input" type="text" placeholder="할 일을 입력하세요." /><button id="add" >+</button>
      </div>
      <div className="list">
        <ul id="to-do-list">
          <li>{ todo }</li>
        </ul>
      </div>
    </div>
  )
}

function Done() {
  return (
    <div>
      <div className="title">
        <h2>Done List</h2>
      </div>
      <div className="list">
        <ul id="done-list"></ul>
      </div>
    </div>
  )
}

export default App;
